import React from 'react'
import {Link} from 'react-router-dom'

function BlogTop(props) {
    const css = {
        body : {
            width: '100%',
            height: '50px',

            backgroundColor: '#0d1a2c',

            display: 'flex',
            justifyContent: 'space-between',
            alignContent: 'center'
        },
        link : {
            height: '24px',

            textDecoration: 'none',
            color: 'white',
            fontSize: '24px',
        },
        div : {
            height: '25px'
        }



    }







    return (
        <div style={css.body}>
            <div style={css.div}>
                <Link to='/blog' style={css.link}>
                    <div>‚ÜêBlog</div>
                </Link>
            </div>
            <div style={css.div}>
                <Link to='/blog' style={css.link}>
                    <div>LOOL</div>
                </Link>
            </div>

        </div>
    )
}

export default BlogTop;
